const ProductItem = ({ product }) => {
  return (
    <>
      <div className="w-75">
        <picture>
          <img
            src={product.img1}
            style={{ height: "200px", width: "200px" }}
            className="mx-auto"
          />
        </picture>
        <div>
          <p>{product.name}</p>
          <p>{product.price}</p>
        </div>
      </div>
    </>
  );
};

export default ProductItem;
